import React, {useState} from 'react';
import { ClientState } from './src/context/client/ClientState';
import { MainLayout } from './src/MainLayout'


export default function App() {

  return (
    <ClientState>
      <MainLayout 
      	style={{width: '100%', backgroundColor: '#c4c4c4'}}
      />
    </ClientState>
  )
}
